import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import styles from './SignInPage.module.css'; // путь к css

export default function SignInPage() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const { signIn } = useAuth();
  const navigate = useNavigate();

  const handleSubmit = async (e) => {
    e.preventDefault();
    const success = await signIn(username, password);
    if (success) {
      navigate('/profile');
    } else {
      alert('Ошибка входа');
    }
  };

  return (
    <div className={styles.pageContainer}>
      <header className={styles.header}>
        <Link to="/">
          <img src="images/logosmall.svg" alt="IdeaFlow logo" style={{ height: 80 }} />
        </Link>
        <nav className={styles.navLinks}>
          <Link to={user ? "/profile" : "/signin"}>Профиль</Link>
          <Link to="/cases">Кейсы</Link>
          <Link to="/projects">Проекты</Link>
          <Link to="/profile">
            <button className={styles.buttonYellow}>Разместить проект</button>
          </Link>
          <Link to="/cases">
            <button className={styles.buttonYellow}>Приступить к проекту</button>
          </Link>
        </nav>
      </header>

      <section className={styles.signInSection}>
        <h2 className={styles.signInTitle}>Вход</h2>
        <form onSubmit={handleSubmit}>
          <input
            className={styles.inputField}
            type="text"
            placeholder="Username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            required
          />
          <input
            className={styles.inputField}
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
          <button type="submit" className={styles.submitBtn}>Войти</button>
        </form>
        <Link to="/register" className={styles.registerLink}>У меня нет аккаунта</Link>
      </section>

      <footer className={styles.footer}>
        <div className={styles.footerLogo}>
          <img src="/images/logobig.svg" alt="IdeaFlow logo" style={{ height: 40 }} />
          IdeaFlow
        </div>
        <div className={styles.footerContacts}>
          Связаться с нами <br />
          <a href="mailto:support@ideaflow.com">support@ideaflow.com</a>
          <br />
          +7 (123) 456-78-90
        </div>
        <div className={styles.footerSocials}>
          <a href="#"><img src="/images/facebook.svg" alt="Facebook" /></a>
          <a href="#"><img src="/images/twitterx.svg" alt="Twitter" /></a>
          <a href="#"><img src="/images/instagram.svg" alt="Instagram" /></a>
        </div>
      </footer>
    </div>
  );
}
